import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const fname="Harshali";
const img1 ="https://picsum.photos/id/1/200/300";
const img2 ="https://picsum.photos/id/1/250/300";
const img3 ="https://picsum.photos/id/1/300/300";


ReactDOM.render(
 <React.Fragment>
    <h1 className="head"> My name is {fname}</h1> 
    <div className="img_div">
   <img src={img1}/>
   <img src={img2}/>

   <img src={img3} target="www.flipkart.com"/>
   </div>


 </React.Fragment>
 ,document.getElementById('root'));
